leetCode-002-Add-Two-Numbers.html.body:
002J. Add Two Numbers
You are given two non-empty linked lists representing two non-negative integers. The digits are stored in reverse order and each of their nodes contain a single digit. Add the two numbers and return it as a linked list.
You may assume the two numbers do not contain any leading zero, except the number 0 itself.
Example:
Input: (2 -> 4 -> 3) + (5 -> 6 -> 4)
Output: 7 -> 0 -> 8
Explanation: 342 + 465 = 807.
Syntax:
Java的 '?' 用法：
max = (a > b) ? a : b ;

等价于
if ( a > b ) {
  return a;
}else{
  return b;
}

Java boolean 转 int
java 中类型转换好麻烦，这里有一个快速的办法。
boolean myBoolean = true; // or false
int booleantToInt = myBoolean ? 1:0;

思路：
先看看LeetCode的 singly-linked-list 的定义：
class ListNode {
  int val;
  ListNode next;

  ListNode(int x) {
    val = x;
  }
}

缺少 sentinel， 我们初始化的时候要自己创建一个没用的头。一般命名为dummyhead.
这样我们处理两个数组的第一位的时候，就可以直接用dummyhead.next()当作第一个被处理的，
这样保证数组处理的同步。

这个题其实很直观，之所以花费了很多功夫
是因为ListNode的Construtor, 并没有给出 next = null;
简单来说就是直接把两个List从前往后一对一的加起来，如果sum > 10 就需要在下一位进一。
所以sum是进位值（0 or 1） 和 两个List该位的值的和。即 sum = carry + p1.val + p2.val
用iteration的方法，需要给两个输入的List各指派一个指针p1, p2。还要新建一个ListNode, reList 作为返回值，并同样指派一个指针pr。
考虑到进位，是要再指定一个用来判断进位的变量 carry。carry 可以是 boolean, 也可以是整型。可以用 sum/10 来直接得到 carry的值。由于carry最多进一位，所以这里 carry = sum/10 显然是更方便的表达。
考虑到两个List 不一样长，那么我们需要判断什么时候让循环停止：那就是当两个List都为null的时候。
注意Leetcode的 ListNode 没有 next = null. 我们不能用 p1.next != null 这样的判断。应使用 while ( p1 != null || p2 != null) { }.
注意要排除空数组的存在。所以上来就要检测空数组。就是因为有空数组，导致我们不能贸然用p1.val, p2.val.我们应当设立两个局域变量 x1, x2 储存 p1.val 和 p2.val 的值。 那么怎么做到一举多得呢？  int x1 = (p1!=null) ? p1.val : 0;
这样才能防止后面用 sum = carry + p1.val + p2.val 时 p1 p2 取不到值。
然后我们就按部就班的让指针指向 List 的下一位即可。
最后循环结束了不要忘记，如果有需要进位的话，还要再新建一节。
由于有dummyhead的存在，所以返回dummyhead.next. 这是容易忘记的。

Java solution:
class Solution {
    public ListNode addTwoNumbers(ListNode l1, ListNode l2) {
        ListNode p1 = l1;
        ListNode p2 = l2;
        ListNode reList = new ListNode(0);
        ListNode pr = reList;
        int carry = 0;

        while(p1 != null || p2 != null) {

            int x1 = (p1 != null) ? p1.val:0;
            int x2 = (p2 != null) ? p2.val:0;
            int sum = carry + x1 + x2;

            carry = sum/10;
            sum = sum%10;

            pr.next = new ListNode(sum);
            pr = pr.next;

            if(p1 != null) {
                p1 = p1.next;
            }
            if(p2 != null){
                p2 = p2.next;
            }
        }
        if( carry == 1 ){
            pr.next = new ListNode(1);
        }
        return reList.next;
    }
}

第二次写的代码,上次是抄答案的。
class Solution {
    public ListNode addTwoNumbers(ListNode l1, ListNode l2) {
        ListNode reHead = new ListNode(0);
        ListNode p = reHead;
        int x1 = 0, x2 = 0;
        int carry = 0;
        while(l1!=null||l2!=null){
            x1 = l1 == null? 0:l1.val;
            x2 = l2 == null? 0:l2.val;
            if(x1+x2+carry >9){
                p.next = new ListNode(x1+x2+carry - 10);
                carry = 1;
            }else{
                p.next = new ListNode(x1+x2+carry);
                carry = 0;
            }
            p = p.next;
            if(l1!=null){
                l1 = l1.next;
            }
            if(l2!=null){
                l2 = l2.next;
            }
        }
        if(carry != 0){
            p.next = new ListNode(1);
        }
        return reHead.next;
    }
}

leetCode-007-Reverse-Integer.html.body:
007. Reverse Integer
Given a 32-bit signed integer, reverse digits of an integer.
Example 1:Input: 123
Output: 321
Example 2:Input: -123
Output: -321
Example 3:Input: 120
Output: 21
Note:Assume we are dealing with an environment which could only store integers within the 32-bit signed integer range: [−2^31,  2^31 − 1]. For the purpose of this problem, assume that your function returns 0 when the reversed integer overflows.
思路:
整数 x, 令除十的余数 x%10 = remain, 返回值 rev = 0
翻转它相当于:

不停的把旧的rev * 10,升一位，加上新的remain 得到新的 rev
然后用 x/10 给x降位，得到新的 x

但是要求不超出整型的范围，那么再得到最终的十位 rev之前，
要进行判断，是否 准备乘10的rev大于 2^31/10，是的话就返回0；
如果等于，就看准备加上的余数 是否大于7（正数） 或 8（负数），如果是就返回0；
Method One:
基本的操作非常简单
int rev = 0;
int remain = 0;
while(x != 0 ){
  remain = x % 10;
  rev = rev*10 + remain;
  x /= 10;
}

难点是如何判断是否要大于或者小于int型的边界呢？方法是在 rev * 10 + remain 之前判断。一个诀窍是可以用 Integer.MAX_VALUE 和 Integer.MIN_VALUE 得到最大和最小的整型值。
java 中 整型的最大最小值其语法如下

Integer.MIN_VALUE
Integer.MAX_VALUE
-2147483648 = -2^31
2147483647 = 2^31 - 1

class Solution {
    public int reverse(int x) {      
        int rev = 0;
        int remain = 0;
        while(x != 0){
            remain = x%10;
            if (rev > Integer.MAX_VALUE/10 ){return 0;}
            if (rev == Integer.MAX_VALUE &&  remain > Integer.MAX_VALUE%10 ){return 0;}
            if (rev  Integer.MIN_VALUE%10 ){return 0;}
            rev = rev*10 + remain;
            x = x/10;
        }
        return rev;
    }
}

leetCode-009-Palindrome-Number.html.body:
009. Palindrome Number
Determine whether an integer is a palindrome. An integer is a palindrome when it reads the same backward as forward.
Example 1:Input: 121Output: true
Example 2:Input: -121
Output: false
Explanation: From left to right, it reads -121. From right to left, it becomes 121-. Therefore it is not a palindrome.
Example 3:Input: 10
Output: false
Explanation: Reads 01 from right to left. Therefore it is not a palindrome.
Follow up:
Coud you solve it without converting the integer to a string?
Method 1
这个办法是先翻转字符 再对比。
class Solution {
    public boolean isPalindrome(int x) {
        int dupx = x;
        if (x > 0 || x == 0){
            int rev = 0;
            while(x != 0){
                rev = 10* rev + x%10;
                x = x/10;
            }
            return rev == dupx;
        }
        else{
            return false;
        }
    }
}

