leetCode-013-Roman-to-Integer.html.body:
013J. Roman to Integer
Roman numerals are represented by seven different symbols: I, V, X, L, C, D and M.
Symbol       Value
I             1
V             5
X             10
L             50
C             100
D             500
M             1000
For example, two is written as II in Roman numeral, just two one's added together. Twelve is written as, XII, which is simply X + II. The number twenty seven is written as XXVII, which is XX + V + II.
Roman numerals are usually written largest to smallest from left to right. However, the numeral for four is not IIII. Instead, the number four is written as IV. Because the one is before the five we subtract it making four. The same principle applies to the number nine, which is written as IX. There are six instances where subtraction is used:

I can be placed before V (5) and X (10) to make 4 and 9.
X can be placed before L (50) and C (100) to make 40 and 90.
C can be placed before D (500) and M (1000) to make 400 and 900.

Given a roman numeral, convert it to an integer. Input is guaranteed to be within the range from 1 to 3999.
Example 1:Input: "III"Output: 3
Example 2:Input: "IV"
Output: 4
Example 3:Input: "IX"
Output: 9
Example 4:Input: "LVIII"
Output: 58
Explanation: L = 50, V= 5, III = 3.
Example 5:Input: "MCMXCIV"
Output: 1994
Explanation: M = 1000, CM = 900, XC = 90 and IV = 4.
Best Method
这是我看过的最好的答案了。

首先从后往前 iteration 这样就从低位 到 高位
由于只有 I X C 会既放在前面也放在后面，所以除了这三个之外的字母 直接 sum += 就可以了
由于 I 只在这个数字大于五的时候 才会出现减1的效果。所以sum大于5, I 会减一
以此类推 X 和 C
特殊例子只有 IV = 4, IX = 9, XL = 40, XC = 90, CD = 400, CM = 900 非常容易验证

这是不可能更好的答案了
class Solution {
    public int romanToInt(String s) {
       int sum = 0;
        for(int i = s.length() - 1; i > -1; i -= 1) {
            char c = s.charAt(i);
            switch(c){
                case 'I':
                    sum += (sum >= 5 ? -1 : 1);
                    break;
                case 'V':
                    sum += 5;
                    break;
                case 'X':
                    sum += (sum >= 50 ? -10 : 10);
                    break;
                case 'L':
                    sum += 50;
                    break;
                case 'C':
                    sum += (sum >= 500 ? -100 : 100);
                    break;
                case 'D':
                    sum += 500;
                    break;
                case 'M':
                    sum += 1000;
                    break;
            }
        }
        return sum;
    }
}

leetCode-019-Remove-Nth-Node-From-End-of.body:
019J. Remove Nth Node From End of List
Given a linked list, remove the n-th node from the end of list and return its head.
Example:
Given linked list: 1->2->3->4->5, and n = 2.
After removing the second node from the end, the linked list becomes 1->2->3->5.
Note:
Given n will always be valid.
Follow up:
Could you do this in one pass?
Method 1:
Class Learned:

Linked List 问题 无论如何，先新建一个dummy head.
返回原链表head，用返回dummyhead.next. 因为 head 本身指的位置是可能被破坏掉的。
其余的内容很简单，首先循环到底得到链表长度。然后循环到需要被删去的链表的上一节，跳过该节即可。Java Solution


class Solution {
    public ListNode removeNthFromEnd(ListNode head, int n) {
        ListNode p = head;
        int counter = 0;

        while (p!= null) {
            p = p.next;
            counter += 1;
        }
        counter -= n;

        ListNode p2 = new ListNode(0);
        p2.next = head;
        p = p2;
        while(counter > 0){
           counter -= 1;
            p = p.next;
        }
        // p = new ListNode(p2.next.val);
        p.next = p.next.next;
        return p2.next;     
    }
}

第二次做的 可读性更好啊似乎
class Solution {
    public ListNode removeNthFromEnd(ListNode head, int n) {
        ListNode dummyhead = new ListNode(0);
        dummyhead.next = head;
        ListNode p = head;
        int L = 0;
        while(p!=null){
            p = p.next;
            L+=1;
        }
        p = dummyhead;
        int count = L - n;
        while(count > 0){
            p = p.next;
            count -= 1;
        }
        p.next = p.next.next;
        return dummyhead.next;
    }
}

