leetCode-138-Copy-List-with-Random-Point.body:
138J. Copy List with Random Pointer
https://leetcode.com/problems/copy-list-with-random-pointer/
这个题是链表里面很难的了
Method 最佳

核心思想是：
先处理next的关系，就是简单的把原链表每一节原地复制一次。
然后处理random指针。
用双指针一直同时指着原节点和其复制的节点，
复制节点的random就是原节点的random的下一位。
然后再把单链表拆开成双链表。
如同DNA复制。

/*
// Definition for a Node.
class Node {
    public int val;
    public Node next;
    public Node random;

    public Node() {}

    public Node(int _val,Node _next,Node _random) {
        val = _val;
        next = _next;
        random = _random;
    }
};
*/
class Solution {
    public Node copyRandomList(Node head) {
        if(head == null){
            return head;
        }
        //先在每个节点后面复制一个节点。
        Node p = head, tempP = head, copyNode = head;
        while(p != null){
            copyNode = new Node(p.val); // 新建复制节点
            tempP = p;      
            p = p.next;
            tempP.next = copyNode;
            copyNode.next = p;
        }
        p = head; // 双指针 p p2 准备开始复制random
        Node p2 = head.next;
        while(p!=null && p.next!= null){
            if(p.random!=null){ //如果random 非空 才需要复制
               p2.random =  p.random.next;
            }
            if(p2.next!=null){ //这是为了防止空指针
                              // 如果p2已经在链表最后了 就不需要移动了
             p2 = p2.next.next;
            }
            p = p.next.next; // p 将会移动到 null 但是无所谓 循环已经停止了
        }
        Node dummyhead = new Node(-1); //新建一个头部。
        Node ph = head;
        p2 = dummyhead;
        p = head.next;
        // 拆链表
        while(p.next!=null){
            ph.next = ph.next.next;
            ph = ph.next;
            p2.next = p;
            p = p.next.next;
            p2 = p2.next;
        }
        // 由于避免空指针。停止的时候链表还没有完全拆完，再手动一步。
        ph.next = null;
        p2.next = p;
        p.next = null;

        return dummyhead.next;
    }
}

leetCode-141-Linked-List-Cycle.html.body:
141J. Linked List Cycle
https://leetcode.com/problems/linked-list-cycle/
最好的办法是用哈希表。其实都需要懂。
Method 1:龟兔赛跑
首先上来判断是否是空ListNode和没有next.
然后建立 dummyhead/ Sentinel
核心是 双指针，一个一次挪一步，一个一次挪两步。
如果有循环的话，那么.next 和 .next.next永远不会为空。
所以如果任意一个为null,就应当终止循环。
如果两个指针指到同一个位置，那么就判断循环了。
!!!!!! 注意 ！！！！！！！
while 那里判断的时候 一定要先判断 p2!= null  再判断 p2.next != NULL
否则的话，如果 p2 是null的话，p2.next 就会报错！
！！！！！！！！！！！！！！
另外dummyhead 这里是冗余的。
public class Solution {
    public boolean hasCycle(ListNode head) {
        if(head == null || head.next == null){
            return false;
        }
        ListNode dummyhead = new ListNode(0);
        dummyhead.next = head;
        ListNode p1 = dummyhead;
        ListNode p2 = dummyhead;
        while( (p1 != null) &&(p2 != null) &&(p2.next!=null)){
            p1 = p1.next;
            p2 = p2.next.next;
            if(p1 == p2){
                return true;
            }
        }
        return false;
    }
}

Method 2: Set
就是把所有的节点都无脑加到一个HashSet里面，然后出现重复就报错。
缺点是运行时间似乎不如上面的方法。但是复杂度也是O(N).看来直接
移动指针还是很快的。
public class Solution {
    public boolean hasCycle(ListNode head) {
        if(head == null || head.next == null){
            return false;
        }
        Set set = new HashSet<>();
        ListNode p = head;
        while(p != null){
            if(set.contains(p)){
               return true;
            }
            set.add(p);
            p = p.next;
        }
        return false;
    }
}

