如果没有出现循环并且等于1，说明是happy number.
class Solution {
    public boolean isHappy(int n) {
        Set mySet = new HashSet();
        while(n!=1){
            mySet.add(n);
            n = nextHappy(n);
            if( mySet.contains(n) ){
                return false;
            }
        }
        return true;
    }
    public static int nextHappy(int n){
        int sum = 0;
        while(n > 0){
            int remainder = n%10;
            sum += remainder * remainder;
            n /= 10;
        }
        return sum;
    }
}

