counting sort, 新建一个比原数组大一的数组，计算值为 x = i 的时候，i 就是了h因子了


class Solution {
    public int hIndex(int[] citations) {
        int n = citations.length;
        int[] countSort = new int[n+1];
        for(int c : citations){
            countSort[Math.min(n,c)]++;
        }
        int sum = 0;
        for(int h = n; h > -1;h--){
            sum+=countSort[h];
            if(sum >= h){
                return h;
            }
        }
        return 0;
    }
}

