    public ListNode plusOne(ListNode head) {
        ListNode rev = reverse(head);
        ListNode p = rev;
        int carry = 0;
        p.val += 1;
        while(p!=null){
            if(p.val + carry > 9){
                p.val = p.val + carry - 10;
                carry = 1;
                p = p.next;
            }else{
                p.val += carry;
                carry = 0;
                return reverse(rev);
            }
        }
        // 能跳出while说明carry 必然为1
        p = new ListNode(1);
        p.next = reverse(rev);
        return p;

    }
}

